import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AdminPanel({ token }) {
  const [services, setServices] = useState([]);
  const [newService, setNewService] = useState('');
  const [message, setMessage] = useState('');
  const [stats, setStats] = useState(null);
  const [editingServiceId, setEditingServiceId] = useState(null);
  const [editServiceName, setEditServiceName] = useState('');

  const fetchServices = async () => {
    const res = await axios.get('http://localhost:5000/services');
    setServices(res.data);
  };

  const fetchStats = async () => {
    const res = await axios.get('http://localhost:5000/admin/stats', {
      headers: { Authorization: `Bearer ${token}` }
    });
    setStats(res.data);
  };

  const addService = async () => {
    if (!newService.trim()) return;
    try {
      await axios.post('http://localhost:5000/services', { name: newService }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMessage('✅ Service added successfully.');
      setNewService('');
      fetchServices();
    } catch (err) {
      setMessage('❌ Failed to add service.');
    }
  };

  const deleteService = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/services/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMessage('✅ Service deleted.');
      fetchServices();
    } catch (err) {
      setMessage('❌ Failed to delete service.');
    }
  };

  const startEdit = (id, name) => {
    setEditingServiceId(id);
    setEditServiceName(name);
  };

  const saveEdit = async () => {
    try {
      await axios.put(`http://localhost:5000/services/${editingServiceId}`, { name: editServiceName }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMessage('✅ Service updated.');
      setEditingServiceId(null);
      setEditServiceName('');
      fetchServices();
    } catch (err) {
      setMessage('❌ Failed to update service.');
    }
  };

  useEffect(() => {
    fetchServices();
    fetchStats();
  }, []);

  return (
    <div className="p-4 mt-6 bg-gray-100 rounded shadow">
      <h2 className="font-bold mb-2 text-lg">Admin: Manage Services</h2>
      {message && <div className="mb-2 text-sm text-green-700">{message}</div>}
      <div className="flex gap-2 mb-4">
        <input value={newService} onChange={e => setNewService(e.target.value)} placeholder="New service name" className="border w-full p-1" />
        <button onClick={addService} className="bg-green-600 text-white px-3 py-1 rounded">Add</button>
      </div>
      <ul>
        {services.map(service => (
          <li key={service._id} className="flex justify-between items-center mb-1">
            {editingServiceId === service._id ? (
              <>
                <input value={editServiceName} onChange={(e) => setEditServiceName(e.target.value)} className="border px-2 py-1 mr-2 rounded" />
                <button onClick={saveEdit} className="text-sm text-blue-600 mr-2">Save</button>
                <button onClick={() => setEditingServiceId(null)} className="text-sm text-gray-500">Cancel</button>
              </>
            ) : (
              <>
                {service.name}
                <div className="flex gap-2">
                  <button onClick={() => startEdit(service._id, service.name)} className="text-sm text-blue-600">Edit</button>
                  <button onClick={() => deleteService(service._id)} className="text-sm text-red-500">Delete</button>
                </div>
              </>
            )}
          </li>
        ))}
      </ul>
      {stats && (
        <div className="mt-6 p-4 bg-indigo-50 rounded-md">
          <h3 className="text-md font-semibold text-indigo-700 mb-2">📊 Admin Stats</h3>
          <p>Total Bookings: <strong>{stats.totalBookings}</strong></p>
          <p>Most Popular Service: <strong>{stats.mostPopularService}</strong></p>
          <p>Total Users: <strong>{stats.totalUsers}</strong></p>
        </div>
      )}
    </div>
  );
}

export default AdminPanel;
